#疫情数据变化分析 :
The absolute value of new suspected diagnoses and deaths did not decline, but the growth rate has eased to 20%;
The confirmed mortality rate, which has dropped to 2.2%, seems to have been lost for three days;
Gradually showing a controlled appearance, to see if this wave of big city back-to-back rework can resist; an unsettling signal is that Beijing and Shanghai from the day before yesterday, the number of confirmed increases have entered the 20 plus / day of magnitude.
